    Commission?s letters dated 2/08/2008, covering the 2007 August Monthly Report.
    Our response is as follows:\t  1. The Totals on the Summary and Detailed Summary
    Pages have been amended and now reflect the correct amounts.  2. H2 Convention
    State ? the H4 activity has been correctly coded  3. The H2 now reports the fundraising
    event codes for activity listed on H4  4. The account name description H3 July
    Activity has been changed to FDP Non Federal Account  5. The contribution refund
    to Edwin Walborsky was the excessive portion of the combined contributions deposited
    on 10/5/06 and 11/2/06.   6. H4 admin event ytd totals now reflect the correct
    ytd amounts  7. The correct event activity codes now report for the payments to
    Brevard County DEC, Lee County DEC, and Collier County DEC.  8. Please be advised
    that no employee spent more than 25% of his/her time on Federal election activity
    (FEA) or activities in connection with a Federal election.  Therefore, the payments
    listed above as well as any payments for benefits were properly paid on the Administrative
    split on Schedule H4 and not 30B.  9. The disbursement to Walborsky and IBEW that
    were previously reported on H4 now report correctly on Schedule B  10. The purpose
    code for site rental on Schedules B and H have been more amended to provide a
    more accurate description.  These expenses were in connection with party fundraisers
    and were not made on behalf of a federal election candidate.  "
